
import React, { Component } from 'react';
import { TouchableOpacity, TabBarIOS, View } from 'react-native';
import { connect } from 'react-redux';
import { Actions, ActionConst } from 'react-native-router-flux';
import { Grid, Row } from 'react-native-easy-grid';
import { Screen, Title, Divider, Spinner, Button, Text } from '@shoutem/ui';
import Profile from '../profile';
import Messages from '../Messages';
import Directory from '../Directory';
import { setIndex } from '../../actions/list';
import { openDrawer } from '../../actions/drawer';
import styles from './styles';

const iconDirectory = 'data:image/false;base64,';
const iconFriends = 'data:image/false;base64,';
const iconProfile = 'data:image/false;base64,';
const iconChat = 'data:image/false;base64,';


class Home extends Component {

  static propTypes = {
    name: React.PropTypes.string,
    setIndex: React.PropTypes.func,
    list: React.PropTypes.arrayOf(React.PropTypes.string),
    openDrawer: React.PropTypes.func,
  }

  state = {
    selectedTab: 'blueTab',
    notifCount: 0,
    presses: 0,
  };

  newPage(index) {
    this.props.setIndex(index);
    Actions.blankPage();
  }

  render() {
    return (
      <Screen>
        <TabBarIOS
          barTintColor="#f8f8f8"
        >
          <TabBarIOS.Item
            title="Chat"
            icon={{ uri: iconChat, scale: 2 }}
            selected={this.state.selectedTab === 'blueTab'}
            onPress={() => {
              this.setState({
                selectedTab: 'blueTab',
              });
            }}
          >
            <Messages />
          </TabBarIOS.Item>
          <TabBarIOS.Item
            title="Directory"
            icon={{ uri: iconDirectory, scale: 2 }}
            badge={this.state.notifCount > 0 ? this.state.notifCount : undefined}
            badgeColor="black"
            onPress={() => {
              this.setState({
                selectedTab: 'redTab',
                notifCount: this.state.notifCount + 1,
              });
            }}
            selected={this.state.selectedTab === 'redTab'}
          >
            <Directory />
          </TabBarIOS.Item>
          <TabBarIOS.Item
            title="Friends"
            icon={{ uri: iconFriends, scale: 2 }}
            selected={this.state.selectedTab === 'greenTabx'}
            onPress={() => {
              this.setState({
                selectedTab: 'greenTabx',
                presses: this.state.presses + 1,
              });
            }}
          >
            <View style={{ flex: 1 }} />
          </TabBarIOS.Item>
          <TabBarIOS.Item
            title="Profile"
            icon={{ uri: iconProfile, scale: 2 }}
            selected={this.state.selectedTab === 'greenTab'}
            onPress={() => {
              this.setState({
                selectedTab: 'greenTab',
                presses: this.state.presses + 1,
              });
            }}
          >
          <Profile />
          </TabBarIOS.Item>
        </TabBarIOS>
      </Screen>
    );
  }
}

function bindAction(dispatch) {
  return {
    setIndex: index => dispatch(setIndex(index)),
    openDrawer: () => dispatch(openDrawer()),
  };
}

const mapStateToProps = state => ({
  name: state.user.name,
  list: state.list.list,
});

export default connect(mapStateToProps, bindAction)(Home);
